import React from 'react';
import './ApplicationList.css';

function ApplicationList() {
  // Mock data for applications
  const applications = [
    { id: 1, name: 'App1', url: 'https://app1.example.com' },
    { id: 2, name: 'App2', url: 'https://app2.example.com' },
    { id: 3, name: 'App3', url: 'https://app3.example.com' },
  ];

  return (
    <div className="application-list-container">
      <h3>Applications</h3>
      <ul>
        {applications.map((app) => (
          <li key={app.id}>
            <span>{app.name}</span>
            <button onClick={() => window.open(app.url, '_blank')}>Access</button>
            <button onClick={() => alert(`Manage ${app.name}`)}>Manage</button>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default ApplicationList;
